webpackJsonp([0xc1f1e778dbbd],{1073:function(e,o){e.exports={data:{package:{id:"clj-collection-apis-reasonml",score:.6038052021415878,name:"clj-collection-apis-reasonml",version:"1.1.0",description:"Adding common functions from Clojure to Reason",keywords:["clojure","bucklescript","clojurescript"],license:"MIT",updated:"2018-01-02T01:01:23.815Z",stars:2,type:"published",quality:.8010466023263754,popularity:.03859945087202575,maintenance:.9999468961099034,readme:'<h1>Clojure Collection APIs in Reason</h1>\n<p>This project aims to implement the Clojure collection APIs for Reason\'s Array and List types whenever they make sense.</p>\n<p>In addition, it provides ports of many of Clojure\'s predicates such as <code>even?</code> and the non-collection API of Scala\'s <code>Option</code> type.</p>\n<p>Reference the unit tests for examples on usage.</p>\n<h2>Using clj-collection-apis-reasonml</h2>\n<p>First, add the dependency to your <code>package.json</code>:</p>\n<pre><code>yarn add clj-collection-apis-reasonml\n</code></pre>\n<p>Then add it to your <code>bsconfig.json</code>:</p>\n<pre><code>"bs-dependencies": [\n  "clj-collection-apis-reasonml"\n],\n</code></pre>\n<p>Finally, you\'re free to use it in your code:</p>\n<pre><code>/* test.re */\nlet myVal = Clj.Array.drop(2, [|1, 2, 3|]);\n/* myVal is now [|3|] */\n</code></pre>\n<h2><a href="https://github.com/jasonrose/clj-collection-apis-reasonml/blob/master/API.md">API Reference</a></h2>\n',homepageUrl:"https://github.com/jasonrose/clj-collection-apis-reasonml",repositoryUrl:"https://github.com/jasonrose/clj-collection-apis-reasonml",npmUrl:"https://www.npmjs.com/package/clj-collection-apis-reasonml",issuesUrl:"https://github.com/jasonrose/clj-collection-apis-reasonml/issues",slug:"packages/clj-collection-apis-reasonml"}},pathContext:{id:"clj-collection-apis-reasonml"}}}});
